import { useState } from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { Table, TableContainer, TableHead, TableCell, TableBody, TableRow, Modal, Button, TextField } from '@material-ui/core';

import styles from '../css/modal.module.css'

const AnalisisCredito = (props) => {

    const [modalState, setModalState] = useState(true);

    const closeModal = () => {
        setModalState(false);
    }

    const useStyles = makeStyles((theme) => ({
        modal: {
            position: 'absolute',
            width: 400,
            backgroundColor: theme.palette.background.paper,
            border: '2px solid #000',
            boxShadow: theme.shadows[5],
            padding: theme.spacing(2, 4, 3),
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)'
        },
        iconos: {
            cursor: 'pointer'
        },
        inputMaterial: {
            width: '100%'
        }
    }));

    const stylesss = useStyles();

    return (
        <Modal open={modalState} className={styles["modal"]}>      
                    <div className="modal-dialog modal-dialog-centered" role="document">
                        <div className="modal-content">
                            <div className="modal-header">
                                <h5 className="modal-title" id="exampleModalLongTitle">Detalle del Cliente</h5>
                            </div>
                            <div className="modal-body">

                            </div>
                            <div className="modal-footer">
                                <button type="button" className="btn btn-primary" onChange={closeModal}>Salir</button>
                            </div>
                        </div>

                    </div>

        </Modal>

    )
};

export default AnalisisCredito;
